import "bootstrap/dist/css/bootstrap.min.css";
function Header() {
    return (
        <div>
            <header className="App-header">
         <GiEarthAfricaEurope className="App-logo" alt="logo" />
        <p>
          Travel Photo Journal
        </p>
      </header>
        </div>
    )
}

export default Header
